searchNodes=[{"doc":"Root level device configuration. Versioned for introspection in the future. Contians configuration for the spect radio network. See the network document for more information.","ref":"Spect.Config.html","title":"Spect.Config","type":"module"},{"doc":"Represents an effect running the device. Effects are implemented as Lua scripts internally. Mode is a bitfield described below There are 8 effect slots total Each slot may use up to or all of the 8 sections on the device. See the sections document for a description of how that works. Mode Bitfield 7 6 5 4 3 2 1 0 effect enable radio sync can sync - - - - - Bits 4-8 are reserved for future use effect_enalbe - enable or disable this effect slot radio_sync - enable or disable syncing of this slot on the network can_sync - enable or disable syncing of this slot via CAN","ref":"Spect.EffectSlot.html","title":"Spect.EffectSlot","type":"module"},{"doc":"","ref":"Spect.Network.html","title":"Spect.Network","type":"module"},{"doc":"","ref":"Spect.Network.Identity.html","title":"Spect.Network.Identity","type":"module"},{"doc":"","ref":"Spect.Network.Leader.html","title":"Spect.Network.Leader","type":"module"},{"doc":"","ref":"Spect.Network.Node.html","title":"Spect.Network.Node","type":"module"},{"doc":"","ref":"Spect.NetworkNode.html","title":"Spect.NetworkNode","type":"module"},{"doc":"","ref":"Spect.Section.html","title":"Spect.Section","type":"module"},{"doc":"","ref":"Spect.Section.html#changeset/2","title":"Spect.Section.changeset/2","type":"function"},{"doc":"","ref":"Spect.SlotSection.html","title":"Spect.SlotSection","type":"module"},{"doc":"","ref":"readme.html","title":"README","type":"extras"}]